let wait=6;
let banner;
let background;
let bannerheader;
let lang;
let spanText;
let imgUA;
let setBanner=false;
function Detect(){
	fetch('https://api.ipregistry.co/?key=tryout')
		.then(function (response) {
			return response.json();
		})
		.then(function (payload) {
			let code=payload.location.country.code;
			if (code=="RU" || code=="BE") UkraineWar2022();
			else if (code=="CN") UkraineWar2022();
			else{
				console.log("country: "+payload.location.country.code);
				console.log("region: "+payload.location.region.code);
			}
		});
}

function Apply() {
	let lang = userLang = navigator.language || navigator.userLanguage; 
	console.log("Apply");
	background = document.createElement("div");
	background.style=
	"width: 100%; "+
	"height: 100%; "+
	"filter: bluer 2px; "+
	"background-color: rgb(0 0 0 / 62%);"+
	"position: absolute;"+
    "margin: 0;"+
	"display: grid;"
    ;
	document.body.prepend(background);
	
	banner = document.createElement("div");
	banner.style=
	"/*width: 100px; "+
	"height: 100px; */"+
	"background-color: white;"+
	"margin: auto;"+
	"display: grid;"+
	"padding: 10px"+
    "justify-content: center;"+
    "justify-items: center;"+
	"border-radius: 5px;"+
	"max-width: calc(100vw - 1cm);"+
	"padding: 10px;"
	;
	background.append(banner);
		
	imgUA=document.createElement("img");
	imgFlag="width: 50%;max-width: 5cm;";
	banner.append(imgUA);
	
	spanText=document.createElement("span");
	spanText.style="font-size: 6mm;text-shadow: 1px 1px 3px rgb(0,0,0,10%);font-family: sans-serif;";
		
	banner.append(spanText);
		
	bannerheader=document.createElement("div");
	bannerheader.innerText="Wait ?s";
	bannerheader.style=
	"font-size: 8mm;text-shadow: 1px 1px 3px rgb(0,0,0,10%);"+
	"background-color: white;"+
	"font-family: sans-serif;"+
	"margin-top: 5mm;"
	;
	banner.append(bannerheader);
	China();
	delay();
}

