function delay() {
	
	wait--;
	console.log(wait);
	switch (lang){
		case "cs":
			bannerheader.innerText="Počkejte "+wait+"s";
			break;
			
		case "ua":
			bannerheader.innerText="Зачекайте "+wait+"с";
			break;
			
		case "ru":
			bannerheader.innerText="Подождите "+wait+"с";
			break;
			
		case "be":
			bannerheader.innerText="Пачакайце "+wait+"c";
			break;
			
		default:
			bannerheader.innerText="Wait "+wait+"s";
			break;
	}
	
	if (wait<=0) {
	//	background.remove();
	}
	else{
		setTimeout(function() {
			delay();
		}, 1000);
	}
}